import { useEffect } from "react";
import { useDispatch } from "react-redux";
import { getLogs } from "../../actions/logs";
import AllLogs from "./AllLogs";

const Logs = () => {
    const dispatch = useDispatch()
    useEffect(() => {
        dispatch((getLogs()))
      }, [] )
    return (
        <div>
            <AllLogs></AllLogs>
        </div>
    );
};

export default Logs;
